import React from 'react';


function Map() {
  
  return (
    <MapContainer center={saigonPosition} zoom={12} style={{ height: '400px', width: '100%' }}>
      <TileLayer
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
      />
      <Marker position={saigonPosition} icon={customIcon}>
        <Popup>Sài Gòn</Popup>
      </Marker>
    </MapContainer>
  );
}

export default Map;
